import myimage from "../../assets/myimage.jpeg";
import mysign from "../../assets/mysign.jpeg";
import classes from "./Mycontact.module.css";
//import { SocialIcon } from "react-social-icons";
import SocialMediaIcons from './SocialMediaIcons';

// const linkedin = ReactDOM.render(
//     <SocialIcon url="https://www.linkedin.com/in/shashi-kumar-0680009b" />,
//     document.body
//   );

//const Licon = <SocialIcon url="https://www.instagram.com/kumarshashi.official/" />;

const Mycontacts = () => {

    const openInNewTab = url => {
        window.open(url, '_blank', 'noopener,noreferrer');
      };
    const ResumeHandler = (event) =>{
        event.preventDefault();
        openInNewTab('https://drive.google.com/file/d/1SY8BwlcYRUVYLJh3tdbTvqMQQx74Dlfm/view?usp=sharing');
    };

  return (
    <div className={classes.contact}>
      <div className={classes.img}>
        <h1>Contact Me</h1>
        <p>
          I am available on almost every social media. You can message me, I
          will reply within 24 hours. I can help you with ML, AI, React,
          Android, Cloud and Opensource Development.
        </p>
        <img src={myimage} />
        <SocialMediaIcons />
        <button onClick={ResumeHandler}>See My Resume</button>
      </div>
    </div>
  );
};

export default Mycontacts;
